import { Outlet } from "react-router/lib/components";
import { Fragment } from "react";

const Navigation = () => {
    return (
      <Fragment>
        <div className="na">
          <h1>I am a navigation Bar...</h1>
          <Outlet />
        </div>
      </Fragment>
    );
  };
  export default Navigation;
